import React from 'react';
import classes from './Order.css';

const order = (props) => {

    return (
        <div className={classes.Order}>
            <p>Ingredient</p>
            <p>Price: <strong>USD {props.totalPrice}</strong></p>
        </div>
    ); 
}

export default order;
